import { Button, Checkbox, Input } from 'antd';
import './pages.scss';

function CreateNewAccountPage() {
  return(
    <div className='sing-up-page'>
      <p className='sing-up-page__header'>Create new account</p>
      <span className='name-input'>Username</span>
      <Input className='input' placeholder="Username" />
      <span className='name-input'>Email address</span>
      <Input placeholder="Email address" />
      <span className='name-input'>Password</span>
      <Input placeholder="Password" />
      <span className='name-input'>Repeat Password</span>
      <Input placeholder="Password" />
      <Checkbox className='checkbox-sing-up'>I agree to the processing of my personal 
      information</Checkbox>

      <Button>Create</Button>
      <p>Already have an account? <a>Sign In.</a></p>
    </div>
  )
}

export default CreateNewAccountPage;
